import React from "react";
import '../Game.css'

function  onClick(ev,id) {
    alert("Clicked" + id);
}

const GameCircle = ({id, color, children}) => {
    //console.log("GameCircle", id, color);
    const style_ = {
        backgroundColor: color
    }
    return <div className="gameCircle" style={style_}  onClick={(ev)=>onClick(ev,id)}> 
        {children}
         </div>;
}

export default GameCircle;
